import "../css/Home.css";
import ItemsPage from "./Items";

const Home = () => {
  return (
    <div className="app">
      <h1>corkboard</h1>
      <div className="search">
        <input ref={codeRef} id="code" placeholder="code..."></input>
      </div>
      <div>
        <button onClick={() => getItemsByCode(codeRef.current.value)}>
          Use Code!
        </button>
        {/* <button>New Code!</button> */}
      </div>
      <ItemsPage />
    </div>
  );
};

export default Home;
